/** Address clean up - written using ORACLE. Order of code matters **/
/** Both address line 1 and address line 2 will be cleaned (excluding city, state, and zip columns). Intended to be validated with a USPS verification tool after this code is ran **/
	/** Examples of addresses that can be cleaned up w/ the code below (whether they're in existing address line 1 or address line 2):
		123 E 1ST ST, SUITE 100
		123 E 1ST ST, STE 100
		123-D E 1ST ST
		PMB 123 400 FLOWER ST
		300 SOUTH AVE #A200
		300 SOUTH AVE #A
		300 SOUTH AVE #200
		5678 EASTVALE LANE FIFTH FLOOR
		5678 EASTVALE LANE 5TH FLOOR
		5678 EASTVALE LANE FLOOR 5
		5678 EASTVALE LANE FLOOR FIVE
		PIER 1 SHED F
		PIER 1 BAY 2
		1000 WATER LILLY WAY C500
		1000 WATER LILY WAY STE B
		etc.**/


/** All column names referenced:

	DATABASE (database name) *CHANGE DATABASE NAME*
	ADDRESS_CLEAN_UP (table name)
	EXISTING_ADDRESS_LINE_1 (existing address line 1 pre cleanup)
	EXISTING_ADDRESS_LINE_2 (existing address line 2 pre cleanup)
	ADDRESS_LINE_1_PREP (EXISTING_ADDRESS_LINE_1 after t0)
	ADDRESS_LINE_2_PREP (EXISTING_ADDRESS_LINE_2 after t0)
	FRST_ADDRESS_LINE_1_CLEANING (separates ADDRESS_LINE_1_PREP into the first line for an address after t1 has run)
	FRST_ADDRESS_LINE_2_CLEANING (separates ADDRESS_LINE_1_PREP into the second line for an address after t1 has run)
	SCND_ADDRESS_LINE_1_CLEANING (separates ADDRESS_LINE_2_PREP into the first line for an address after t1 has run)
	SCND_ADDRESS_LINE_2_CLEANING (separates ADDRESS_LINE_2_PREP into the second line for an address after t1 has run)
	ADDRESS_LINE_1_COMBO (FRST_ADDRESS_LINE_1_CLEANING and/or SCND_ADDRESS_LINE_1_CLEANING after t2 has run)
	ADDRESS_LINE_2_COMBO (FRST_ADDRESS_LINE_2_CLEANING and/or SCND_ADDRESS_LINE_2_CLEANING after t2 has run)
	ADDRESS_LINE_1_FINAL_CLEANSE (last cleanse of ADDRESS_LINE_1_COMBO after t3 has run)
	ADDRESS_LINE_2_FINAL_CLEANSE (last cleanse of ADDRESS_LINE_2_COMBO after t3 has run)
	NEW_ADDRESS_LINE_1 (final version ready to be validated with a USPS verification tool)
	NEW_ADDRESS_LINE_2 (final version ready to be validated with a USPS verification tool)
